//noinspection CssUnknownTarget
@import "@/static/css/common.scss";
.body {
  display: flex;

  .pocket-card {
    width: 22%;
    height: 600px;
    position:relative;

    .run-button {
      width: 100%;
      height: 40px;
      font-size: 120%;
    }

    .tree-list {
      height: 520px;

      .custom-tree-node {
        flex: 1 1 auto;
        display: flex;
        align-items: center;
        justify-content: space-between;
        font-size: 14px;
        padding-right: 8px;
        width: 100%;

        .node-title {
          width: 0;
          text-overflow: ellipsis;
          white-space: nowrap;
          flex: 1 1 auto;
          padding: 0 5px;
          overflow: hidden;
        }

        .node-operate > i {
          color: #409eff;
          margin: 0 5px;
        }

        .children-content {
          width: 150px;
          overflow:hidden;
          text-overflow:ellipsis;
          white-space:nowrap;
        }

        .delete-icon {
          display: none;
        }
      }

      .father .child {
        display: none;
      }

      .father:hover .child {
        display: block;
      }

      .custom-tree-node:hover .delete-icon{
        display: block;
      }
    }


  }

  .case-manage-card {
    width: 78%;
    height: 600px;
    margin-left: 5px;

    .row-name {
      width: 120px
    }

    .row-category {
      width: 100px;
      margin-left: 10px
    }

    .row-creater {
      width: 100px;
      margin-left: 10px;
      .name {
        float: left;
      }
      .code {
        float: right;
        color: #8492a6;
        font-size: 13px;
      }
    }

    .case-table {
      height: 520px;
      margin-top: 10px;
      width: 100%;

      .GET {
        color: #00C292;
        font-weight: 500;
      }
      .POST {
        color: #409EFF;
        font-weight: 500;
      }
      .PUT {
        color: #E6A23C;
        font-weight: 500;
      }
      .DELETE {
        color: #E46A76;
        font-weight: 500;
      }
    }
  }
}

.el-tree /deep/ .is-expanded {
  color: #333333;
  font-weight: bold

}
